using Newtonsoft.Json;
using Servicio.Enrolador;
using System;
using System.Collections.Generic;
using System.ComponentModel;
using System.Configuration;
using System.IO;
using System.Linq;
using System.Net;
using System.Text;
using System.Threading.Tasks;

namespace Servicio.Enroler.Server
{
    public enum RequestMethod
    {
        [Description("GET")]
        GET = 0,
        [Description("POST")]
        POST = 1,
        [Description("DELETE")]
        DELETE = 2,
        [Description("UPDATE")]
        UPDATE = 3,
        [Description("PUT")]
        PUT = 4,
    }

    public class ServerListener
    {
        public static HttpListener _listener;

        public static async void Start()
        {
            try
            {
                string host = ConfigurationManager.AppSettings["Host"];
                string port = ConfigurationManager.AppSettings["Port"];

                _listener = new HttpListener();
                _listener.Prefixes.Add("http://" + host + ":" + port + "/");
                _listener.Prefixes.Add("http://localhost:" + port + "/");
                _listener.Start();

                Utilidades.MensajeLog("Servicio iniciado correctamente");
                Receive();
            }
            catch (Exception ex)
            {
                Utilidades.MensajeLog("Error en inicio: " + ex);
            }
        }

        public static async void Stop()
        {
            _listener.Stop();
        }

        public static async void Receive()
        {
            _listener.BeginGetContext(new AsyncCallback(ListenerCallback), _listener);
        }

        public static async void ListenerCallback(IAsyncResult result)
        {
            if (_listener.IsListening)
            {
                HttpListenerContext context = _listener.EndGetContext(result);
                var request = context.Request;
                string body = "";
                using (var reader = new StreamReader(request.InputStream, request.ContentEncoding))
                {
                    body = reader.ReadToEnd();
                }

                RequestMethod method = RequestMethod.GET;
                string action = "";
                dynamic msg = "";

                HttpListenerResponse response = context.Response;
                try
                {
                    method = (RequestMethod)Enum.Parse(typeof(RequestMethod), request.HttpMethod, true);
                    //headerToken = request.Headers.GetValues("x-api-key").FirstOrDefault();
                    action = request.Headers.GetValues("x-action").FirstOrDefault();
                    msg = await ProcessResponse(method, action, body);
                }
                catch (Exception ex)
                {
                    msg = JsonConvert.SerializeObject(new { Response = new { Type = "ERROR", Data = "La peticion no cumple los requisitos" } });
                }

                byte[] buffer = Encoding.UTF8.GetBytes(msg.ToString());
                response.ContentLength64 = buffer.Length;
                Stream st = response.OutputStream;
                st.Write(buffer, 0, buffer.Length);

                context.Response.Close();

                Receive();
            }
        }

        public static async Task<string> ProcessResponse(RequestMethod method, string action, string body = "")
        {
            try
            {
                if (method == RequestMethod.GET)
                {
                    if (action == "ObtenerEstado")
                    {
                        bool res = await ENRService.ObtenerEstado();
                        if (res)
                            return JsonConvert.SerializeObject(new { Response = "SUCCESS", Message = "Metodo " + method.ToString() + " correcto.", Status = "Connect" });
                    }
                    else if (action == "ObtenerHuella")
                    {
                        Entities.Standard.Enrolador huella = await ENRService.EnrolarHuella();
                        if (huella.CalidadHuella == Entities.Standard.CalidadDeHuellaEnum.Error && huella.EstadoDeServicio != Entities.Standard.EstadosDevueltosPorServicio.Success)
                        {
                            return JsonConvert.SerializeObject(new { Response = "ERROR", Message = huella.Error + " o el dispositivo no se encuentra conectado.", DeviceStatus = huella.EstadoDeServicio.ToString() });
                        }
                        return JsonConvert.SerializeObject(new { Response = "SUCCESS", Calidad = huella.CalidadHuella.ToString(), DeviceStatus = huella.EstadoDeServicio.ToString(), Template_Biostar = Convert.ToBase64String(huella.Template), Template = huella.ImageAsBytes });
                    }
                    else if (action == "ValidarHuella")
                    {
                        Entities.Standard.Enrolador huella = await ENRService.VerificarHuella(body);
                        if (huella.CalidadHuella == Entities.Standard.CalidadDeHuellaEnum.Error && huella.EstadoDeServicio != Entities.Standard.EstadosDevueltosPorServicio.Success)
                        {
                            return JsonConvert.SerializeObject(new { Response = "ERROR", Message = huella.Error + " o el dispositivo no se encuentra conectado.", DeviceStatus = huella.EstadoDeServicio.ToString() });
                        }
                        return JsonConvert.SerializeObject(new { Response = "SUCCESS", Calidad = huella.CalidadHuella.ToString(), DeviceStatus = huella.EstadoDeServicio.ToString(), Resultado_Comparacion = huella.ValorComparacion });
                    }
                    else if (action == "ObtenerHuellaPrueba")
                    {
                        return JsonConvert.SerializeObject(new { Response = "SUCCESS", Calidad = "Buena", DeviceStatus = "Conectado", Template_Biostar = "", Template = "" });
                    }
                    return JsonConvert.SerializeObject(new { Response = "SUCCESS", Message = "Metodo " + method.ToString() + " incorrecto." });
                }
                else
                {
                    return JsonConvert.SerializeObject(new { Response = "ERROR", Message = "Metodo " + method.ToString() + " no encontrado." });
                }
            }
            catch (Exception ex)
            {
                return JsonConvert.SerializeObject(new { Response = "ERROR", Message = "Se produjo un error al reconocer el metodo." });
            }
        }
    }
}
